'''{{lj|月射録 ~ The Moon-shooter}}'''是由Sensitive Heart制作并发行的东方同人专辑，该专辑首次发行2005年5月4日的第二回博麗神社例大祭上，场贩售价为800日元，通贩售价为1100日元
===介绍===
本专辑的曲风被评价为“优雅从容而吟叙高潮，极尽柔情而中爆发”，专辑全部为《东方永夜抄》的原曲再编<br />
值得一提的是，本专辑第八首《{{lj|竹取飛翔 ～ Lunatic Princess}}》无论是营造的意境还是编曲水准均极为出色，成为了本专辑中最为惊艳的一笔
